@Cdenquete 
La Ministre de la transition énergétique, @AgnesRunacher a beaucoup de mal à convaincre son interlocuteur @tristanwaleckx !
Il lui assene des chiffres comme un boxeur des uppercuts et elle, complètement groggy lui répond : " mais je ne serai plus Ministre en 2050 ! "

Le @partibreton22 était présent à cette première réunion publique avec
 @Myriam_Rolland_ et @joannicmartin pour entendre les propositions d'Horizon concernant la transition énergétique. 
Au plaisirs d'échanger à nouveau ensemble sur d'autres thèmes !

Je vous ai déjà parlé de @Tv4Planet n'est-ce pas ? J'annonce la sortie du nouvel épisode de " Un café décroissant ", notre émission qui traite le sujet de la transition énergétique avec humour.

 @MatthieuBrd déjeune avec @GMeurice et @philippebihouix

Enjoy !

